import React, {Component} from 'react';
import Listitem from './components/Listitem';
import './App.css';

class Todo extends Component {
  render(){

    let theList = [
      'Twiddle thumbs',
      'Tease the cat',
      'Make babies cry'
    ]

    return (
    <>
      <h1> Things I should stop procrastinating:</h1>
      <ul>
        <Listitem todoItems={theList} test='I am hungry'/>
      </ul>
    </>
    )
  }
}

export default Todo;
